using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.Diagnostics;
using System.Linq;
using System.Text;
using System.Threading;
using System.Threading.Tasks;

namespace wcm.wspectra.decoders.RandomTest
{
    public class RandomDecoder : IDecoder
    {
        const int FFT_POINT_COUNT = 256;
        const int MODE_COUNT_MIN = 50; 
        const int MODE_COUNT_MAX = 150;
        public event PropertyChangedEventHandler PropertyChanged;
        static object sInstanceCnt = (int)0;
        int m_nInstanceId;
        bool m_boIsStarted;
        Random m_tRnd;
        Task m_tFFTTask;
        public RandomDecoder()
        {
            m_tFFTTask = Task.Factory.StartNew(() => { });
            m_tRnd = new Random();
            lock (sInstanceCnt)
            {
                int lCnt = (int)sInstanceCnt;
                m_nInstanceId = lCnt;
                sInstanceCnt = (int)lCnt + 1;
            }
            var lModeCount = m_tRnd.Next(MODE_COUNT_MAX - MODE_COUNT_MIN) + MODE_COUNT_MIN;
            var lModes = new List<IMode>();
            
            for (int i = 0; i < lModeCount; ++i)
            {
                lModes.Add(new RandomMode(m_tRnd));
            }
            
            this.SupportedModes = lModes;

        }
        public bool Start()
        {
            Stop();
            m_boIsStarted = true;
            m_tFFTTask = Task.Factory.StartNew(_FFTTaskProc);
            return true;
        }

        public void Stop()
        {
            m_boIsStarted = false;
            m_tFFTTask.Wait();
        }

        public string Name
        {
            get { return "Random decoder"; }
        }

        public string Id
        {
            get { return "RandomDecoder" + m_nInstanceId; }
        }

        public bool IsStarted
        {
            get { return m_boIsStarted; }
        }

        public IEnumerable<IMode> SupportedModes
        {
            get;
            private set;
        }

        IMode m_tCurrentMode = null;
        public IMode CurrentMode
        {
            get { return m_tCurrentMode; }
            set
            {
                if( value != m_tCurrentMode )
                {
                    m_tCurrentMode = value;
                    _NotifyPropertyChanged("CurrentMode");
                }
            }
        }

        public event FFTDataReceivedEventHandler FFTDataReceived;

        public event TextDataReceivedEventHandler TextDataReceived;

        protected void _NotifyPropertyChanged(string aPropertyName)
        {
            var lHandler = PropertyChanged;
            if (lHandler != null)
                lHandler(this, new PropertyChangedEventArgs(aPropertyName));
        }


        private void _FFTTaskProc()
        {
            double[] m_tFFTPoints = Enumerable.Repeat<double>(0.5, FFT_POINT_COUNT).ToArray();
            var lWatch = new Stopwatch();
            lWatch.Restart();
            while (m_boIsStarted)
            {
                if (lWatch.Elapsed.TotalMilliseconds > 50)
                {
                    var lMaxOffset = 0.05;
                    var lMod = m_tRnd.Next(10) + 1;
                    for (int i = 0; i < m_tFFTPoints.Length; i++)
                    {
                        if (i % lMod == 0)
                        {
                            var lOffsetY = lMaxOffset * (m_tRnd.NextDouble() - 0.5);
                            if (m_tFFTPoints[i] < 0.03 || m_tFFTPoints[i] > 0.097)
                                lOffsetY *= -1;
                            m_tFFTPoints[i] += lOffsetY;
                        }
                    }
                    if (FFTDataReceived != null)
                        FFTDataReceived(m_tFFTPoints);

                    if(TextDataReceived!= null)
                        TextDataReceived(DECODER_OUTPUT.Substring(m_nDecoderOutputIdx, 1), false);

                    m_nDecoderOutputIdx ++;
                    if(m_nDecoderOutputIdx >= DECODER_OUTPUT.Length)
                        m_nDecoderOutputIdx = 0;

                    lWatch.Restart();
                }
                else
                {
                    Thread.Sleep(10);
                }
            }
        }

